// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract EtherGiveaway {
    address public admin;
    uint256 public totalCoupons = 0;

    // Modifier to restrict access to the admin
    modifier onlyAdmin() {
        require(msg.sender == admin, "Action restricted to admin");
        _;
    }

    // Modifier to check if the caller is the selected winner
    modifier isWinner(uint256 couponId) {
        require(couponBook[couponId].winner == msg.sender, "Caller is not the assigned winner");
        _;
    }

    // Events for logging activities
    event EtherDonated(address indexed donor, uint256 amount, uint256 couponId);
    event WinnerSelected(uint256 couponId, address indexed winner);

    // Struct to store coupon details
    struct GiveawayCoupon {
        address donor;
        uint256 etherAmount;
        address winner;
        bool isClaimed;
    }

    // Mapping to store all giveaway coupons
    mapping(uint256 => GiveawayCoupon) public couponBook;

    // Constructor to set the admin
    constructor() {
        admin = msg.sender;
    }

    // Function to donate Ether and generate a giveaway coupon
    function createDonation() external payable {
        require(msg.value > 0, "Donation must be greater than zero");

        // Adding a new giveaway coupon
        couponBook[totalCoupons] = GiveawayCoupon({
            donor: msg.sender,
            etherAmount: msg.value,
            winner: address(0),
            isClaimed: false
        });

        emit EtherDonated(msg.sender, msg.value, totalCoupons);
        totalCoupons++;
    }

    // Admin function to select a winner for a specific coupon
    function selectWinner(uint256 couponId, address winnerAddress) external onlyAdmin {
        require(couponId < totalCoupons, "Invalid coupon ID");
        require(couponBook[couponId].winner == address(0), "Winner has already been selected");

        couponBook[couponId].winner = winnerAddress;
        emit WinnerSelected(couponId, winnerAddress);
    }

    // Function for the winner to claim the Ether from the coupon
    function redeemCoupon(uint256 couponId) external isWinner(couponId) {
        require(couponId < totalCoupons, "Invalid coupon ID");
        require(!couponBook[couponId].isClaimed, "This coupon has already been claimed");

        uint256 prizeAmount = couponBook[couponId].etherAmount;
        couponBook[couponId].isClaimed = true;

        (bool sent, ) = msg.sender.call{value: prizeAmount}("");
        require(sent, "Ether transfer failed");
    }

    // Function to get details of a specific coupon
    function viewCoupon(uint256 couponId) external view returns (address, uint256, address, bool) {
        require(couponId < totalCoupons, "Invalid coupon ID");
        GiveawayCoupon memory coupon = couponBook[couponId];
        return (coupon.donor, coupon.etherAmount, coupon.winner, coupon.isClaimed);
    }
}

